INSERT INTO `user_sessions` VALUES ('Anand_21d224fd-a97d-42ec-a212-0d15aab91a2d','Anand','21d224fd-a97d-42ec-a212-0d15aab91a2d','\n        <p><strong>Bot:</strong> Welcome! What would you like to do?</p>\n    ','2025-06-10T10:58:13.879000+00:00','DOC_complex_travel_booking_form-0d19771e-9d18-4b69-bdb3-cdb005076265.pdf'),('Anand_21d224fd-a97d-42ec-a212-0d15aab91a2d','Anand','21d224fd-a97d-42ec-a212-0d15aab91a2d','\n        <p><strong>Bot:</strong> Welcome! What would you like to do?</p>\n    ','2025-06-10T11:01:14.995000+00:00','DOC_complex_travel_booking_form-1b6daae5-080a-484d-bcfc-187f773f2f89.pdf'),('Anand_21d224fd-a97d-42ec-a212-0d15aab91a2d','Anand','21d224fd-a97d-42ec-a212-0d15aab91a2d','<p><strong>Bot:</strong> Welcome! What would you like to do?</p><div class=\"chat-message user\">full name is sai</div><div class=\"chat-message bot\">Thank you for providing your full name, Sai! However, I need more information to fill out the rest of the form, including your Date of Birth, Passport Number, and other details. Could you please provide these?</div><div class=\"chat-message user\">date of birth is 17/3/2002</div><div class=\"chat-message bot\">Thank you for providing your date of birth! I have updated the \'Date of Birth\' field to \'2002-03-17\'. However, the other fields still require your input. Please provide additional information for the remaining fields.</div>','2025-06-10T11:19:03.838000+00:00','DOC_complex_travel_booking_form-a7452ce8-39e5-4c85-b726-19ef55cba5de.pdf'),('Anand_21d224fd-a97d-42ec-a212-0d15aab91a2d','Anand','21d224fd-a97d-42ec-a212-0d15aab91a2d','\n        <p><strong>Bot:</strong> Welcome! What would you like to do?</p>\n    ','2025-06-10T10:56:44.575000+00:00','DOC_fillableform-0d6f246e-472e-401a-bca4-a5552335b297.pdf'),('Anand_21d224fd-a97d-42ec-a212-0d15aab91a2d','Anand','21d224fd-a97d-42ec-a212-0d15aab91a2d','\n        <p><strong>Bot:</strong> Welcome! What would you like to do?</p>\n    <div class=\"chat-message user\">gender is male</div><div class=\"chat-message bot\">Thank you for providing your gender as Male! I noticed that the fields for Newsletter Subscription, Comments, and Terms and Conditions are still empty. Would you like to provide any preferences for the newsletter or share any comments? Please let me know if you are satisfied with this response.</div><div class=\"chat-message user\">comments is good</div><div class=\"chat-message bot\">Thank you for your input! I\'ve updated the Comments field to reflect your positive feedback. Since the Newsletter Subscription and Terms and Conditions fields were not addressed, they remain as \'NO INFORMATION PROVIDED\'. Are you satisfied with these updates?</div><div class=\"chat-message user\">full name is sai</div><div class=\"chat-message bot\">Thank you for providing your full name, Sai! However, I noticed that several fields such as Date of Birth, Passport Number, and Nationality are still missing. Could you please provide more details so I can assist you further? Are you satisfied with the generated responses?</div>','2025-06-10T10:56:47.951000+00:00','DOC_fillableform-7cafba7a-8eff-4e01-82a8-b0e7bb80e6f2.pdf'),('Anand_21d224fd-a97d-42ec-a212-0d15aab91a2d','Anand','21d224fd-a97d-42ec-a212-0d15aab91a2d','\n        <p><strong>Bot:</strong> Welcome! What would you like to do?</p>\n    <div class=\"chat-message user\">gender is male and comment is good</div><div class=\"chat-message bot\">Thank you for your input! I have updated the \'Gender\' to \'Male\', added a \'Newsletter Subscription\' response, and confirmed your \'Comments\' as \'Good\'. Are you satisfied with these generated responses?</div><div class=\"chat-message user\">Hi my name is sai</div><div class=\"chat-message bot\">Thank you for sharing your name, Sai! I\'ve noted your full name. However, I still need additional information such as your date of birth, passport number, nationality, and other travel details to complete the form. Are you satisfied with the generated responses